    }
  ];

  return (
    <div className="bg-light">
      <div className="divider"></div>
      <Hero />
      <div className="divider"></div>
      <div className="container mx-auto">
        <h5 className="mt-5 mb-2 mx-2">Find a Project Category</h5>
        <Row>
          {projectCategories.map((project, index) => (
            <ProjectCategoryCard project={project} index={index} key={index} />
          ))}
        </Row>
      </div>
    </div>
  );
};

export default Main;
